import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import RegisterModal from './RegisterModal';
import LoginModal from './LoginModal';
import {
  Navbar, 
  NavItem,
  Button,
  Nav
} from 'react-bootstrap';

class MyNav extends Component {


  loginModalRef = ({handleShow}) => {
    this.showModal = handleShow;
 }

 registerModalRef = ({handleRegShow}) => {
  this.showModal = handleRegShow;
}

 onLoginClick = () => {
   this.showModal();
 }

 onRegisterClick = () => {
  this.showModal();
}


    render() { 
        return (
        <Navbar>
            <LoginModal ref={this.loginModalRef} ></LoginModal>
            <LoginModal ref={this.registerModalRef} ></LoginModal>
            <Navbar.Brand href="#home">Clint Do-Me Son's Poker Dojo</Navbar.Brand>
            <Navbar.Toggle />
              <Navbar.Collapse className="justify-content-end">
                <Button onClick={this.onLoginClick}>Login</Button>
                <Button onClick={this.onRegisterClick}>Register</Button>
              </Navbar.Collapse>
          </Navbar>);
    }
}

export default MyNav;
